import React from "react";
import { Route } from "react-router-dom";
import UpravljanjeNalozima from "./pages/Admin/UpravljanjeNalozima";
import './App.css';

function App() {
  return (
            <Route exact path={"/upravljanjeNalozima"}>
                <UpravljanjeNalozima />
            </Route>
  );
}

export default App;
